import styles from "./Jobs.module.scss";
import DeleteIcon from "@mui/icons-material/Delete";

const Job: React.FC<JobType> = (props: JobType) => {
  const createdData: Date = new Date(props.createdAt);
  const updateData: Date = new Date(props.updatedAt);

  const countDate = (updated: Date, created: Date): string => {
    const differInSecs: number = (updated.getTime() - created.getTime()) / 1000;
    const days: number = differInSecs / 86400;
    const end: string = days > 1 ? "days" : "day";
    return `${Math.floor(days)} ${end}`;
  };

  return (
    <div className="max-w-md mx-auto my-2 bg-white rounded-xl shadow-md overflow-hidden md:max-w-6xl">
      <div className="md:flex">
        <div className="md:shrink-0">
          <img
            className="h-20 w-20 md:h-16 md:w-16 rounded-full"
            src={props.pictures[0]}
            alt="Modern building architecture"
          ></img>
        </div>
        <div className="p-8">
          <div className="uppercase tracking-wide text-sm text-indigo-500 font-semibold">
            {props.title}
          </div>
          <a
            href="#"
            className="block mt-1 text-lg leading-tight font-medium text-black hover:underline"
          >
            <p>Departament name</p>
            <li>{props.name}</li>
          </a>
          <SvgIcon>
